INSERT INTO `v1_8f8f6e3ecf8c9337c0e089dd905abc93eed313d625a874023d87b7827cf02a30` VALUES (5, 0, 513048, "クウカはこんな新年早々に\n豪華な料理とたくさんの人の前で\nドSさんに弄ばれ辱めを……！\nぐふふ……ぐふふふふ。", 0, 104511, 11, 513, 1, 0, 0.5);
